                  alt="Video Speech Trainer"
                />
                <img
                  id="cocktail-generator-text"
                  src={
                    process.env.PUBLIC_URL + "/images/homepage/Products5.png"
                  }
                  alt="First Words"
                />
              </div>
            </NavLink>
          </div>
        </div>
        <div className="row-4">
          <img
            id="make-my-cocktail-image"
            src={process.env.PUBLIC_URL + "/images/homepage/Products6.png"}
            alt="home-learning-center"
          />
        </div>
      </div>
    </div>
  );
}

export default Home;
